INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1003501043, /*drama_id*/1003501, /*command_type*/11, /*param_01*/100311, /*param_02*/"私の誕生日を覚えていただけでなく\nケーキまで用意してくれて……\nえ、これってキミの手作りなの！？", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
