INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1003501046, /*drama_id*/1003501, /*command_type*/11, /*param_01*/100311, /*param_02*/"これでもキミの師匠のつもりだったのに\nこういう細やかな気遣いは\nキミの方が上手みたいだ……\nふふ、なんだか誇らしさすら感じるよ。", /*param_03*/6, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
