INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1050501040, /*drama_id*/1050501, /*command_type*/11, /*param_01*/105011, /*param_02*/"きゃ〜！　すごく素敵なケーキ！\n早く食べたい〜！　……こ、こほん。\nア、アタシの誕生日だもん。祝うなら\nこれくらい準備するのは当然よね。", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
