INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1050501043, /*drama_id*/1050501, /*command_type*/11, /*param_01*/105011, /*param_02*/"でも、いい心がけよ♪\nアタシの誕生日を覚えてたなんて\nやっぱり学校の男子とは違うわね！\nなかなか見どころあるじゃない！", /*param_03*/6, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
