INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1050501046, /*drama_id*/1050501, /*command_type*/11, /*param_01*/105011, /*param_02*/"それでアンタ、この後も予定は\n空けてるんでしょうね？\n今日は一日、アタシのエスコートを\nしてくれるかしら？", /*param_03*/7, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
